import './App.css';
import Greetings from './greetings';

function App() {
  const person = {
    name: 'Benjamón'
  }
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hola mundo</h1>
        <Greetings 
          props={person.name}
        />
      </header>
    </div>
  );
}

export default App;
